script: |
  super -f text -I q5128.spq | sort > q5128.out

inputs:
  - name: q5128.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE - col0 + - + 21 * - col0 * + + col1 NOT BETWEEN - 43 + col0 AND col2 + col2;
  - name: tab1

outputs:
  - name: q5128.out
    data: |
      51	14	96
      85	5	59
      91	47	68
